import React from 'react'
import { makeStyles } from "@material-ui/core/styles";
import { AppBar, Toolbar, IconButton, Button, Typography} from '@material-ui/core';
import { red } from '@material-ui/core/colors';
import img1 from '.././images/batterysync dark mode name .png';


const useStyles = makeStyles((theme) => ({ 

    root: {
        flexGrow: 1,
      },
      menuButton: {
        marginRight: theme.spacing(2),
      },
      title: {
        flexGrow: 1,
      },

      img1: {
          marginLeft: theme.spacing(2),
      }

}))


const Navbar = () => {

    const classes = useStyles(); // and this

    return (


  <div className={classes.root}>
        <AppBar position="static" style = {{backgroundColor: "#2B2D2F"}}>
          <Toolbar>
            <Typography variant="h6" className={classes.title}>
                <img src = {img1} position = "left"/>
            </Typography>
            <Button color = "inherit" style = {{color: "#ffa303"}} >Log Out</Button>
          </Toolbar>
        </AppBar>
      </div>

    )
}


export default Navbar
